Im so stoked to share this beautiful work with yall.  @claydohboon Called me bout 2 months ago while i was making my 3 day trek out to Nashville. He said “Can I make a music video for Hollywood Vampire?” I, of course said, YES! DUH! Clay is one of my FAVORITE dancer / Choreographers and overall creatives. So I was honored when he asked :) This one hits a little different because in fact I wasn’t really able to be hands on in the whole process of making it. Clay and i had a few discussions about tone and vibe and look, but other that i just let him take my credit card and take the wheel.  Which is a first for me. I’m usually so involved that by the time we get to the finished product i’m so sick of it. I was very pleased to watch this for the first time and just ENJOY it!  What a feeling!  Also, i literally had no notes. Hope y’all enjoy it as much as i do! Link to full video ☝️
#outlawrnb #hollywoodvampire #reels #dance

